module.exports = JSON.parse('[{"id":1,"name":"Aisha","submission":"I\'m Aisha, a 25-year-old software engineer from Lagos, Nigeria. My 2023 story has been a mix of ups and downs. On the one hand, I\'ve been fortunate enough to secure a job at a top tech company and start building my career. On the other hand, the economic situation in Nigeria has been challenging, and I\'ve had to deal with rising inflation and the high cost of living. Despite the challenges, I\'m optimistic about the future. I believe that Nigeria has a lot of potential, and I\'m excited to be a part of the generation that is working to build a better future for our country.","date":"2023-11-04","twitter":true},{"id":2,"name":"Kwame","submission":"Hello, I\'m Kwame, a farmer from Accra, Ghana. 2023 has been a year of hard work and perseverance for me. The agricultural sector faced its challenges with unpredictable weather patterns and crop diseases. Despite this, I\'ve managed to adapt my farming techniques and collaborate with fellow farmers to overcome these challenges. We are hopeful for better yields in the future and are working towards sustainable farming practices.","date":"2023-11-04","twitter":true},{"id":3,"name":"Fatima","submission":"Greetings, I\'m Fatima, a teacher from Nairobi, Kenya. This year, I\'ve witnessed the resilience of my students in the face of adversity. The education system has faced disruptions due to the ongoing pandemic, but my students have shown incredible determination to continue learning. It\'s heartening to see their enthusiasm for education, and I\'m committed to supporting them in every way possible. Together, we are overcoming the challenges and building a brighter future.","date":"2023-11-04","twitter":true},{"id":4,"name":"Chijioke","submission":"Hey there, I\'m Chijioke, an entrepreneur from Abuja, Nigeria. 2023 has been a rollercoaster ride for my business. We faced supply chain disruptions, increased production costs, and fluctuating consumer demand. However, we\'ve adapted by exploring new market opportunities and diversifying our product range. It hasn\'t been easy, but the challenges have taught us valuable lessons. We are emerging stronger, more innovative, and ready to face whatever comes our way.","date":"2023-11-04","twitter":true},{"id":5,"name":"Lulama","submission":"Hi, I\'m Lulama, an environmental activist from Cape Town, South Africa. 2023 has been a year of advocacy and raising awareness about climate change. Despite the setbacks and lack of sufficient government action, our grassroots movement has gained momentum. Communities are coming together to protect our natural resources, and more people are joining the fight against climate change. It\'s inspiring to see the collective effort, and I\'m hopeful that our actions will lead to positive change.","date":"2023-11-04","twitter":true},{"id":6,"name":"Amara","submission":"Hello, I\'m Amara, a healthcare worker from Dakar, Senegal. 2023 has been a year of challenges and triumphs in the healthcare sector. The pandemic has strained our resources, but the dedication of healthcare professionals and the support from the community have been remarkable. We\'ve worked tirelessly to provide care and save lives. Despite the exhaustion, the spirit of solidarity keeps us going. We are resilient, and together, we are making a difference.","date":"2023-11-04","twitter":true},{"id":7,"name":"Ngozi","submission":"Greetings, I\'m Ngozi, a student from Lagos, Nigeria. 2023 has been a challenging year academically and emotionally. The shift to online learning was difficult, and the digital divide became more apparent. Many students, including myself, faced difficulties accessing resources and adapting to the new learning environment. Despite the hurdles, I\'ve persevered with the support of my teachers and peers. I\'m determined to overcome these challenges and continue my education, hopeful for a brighter future.","date":"2023-11-04","twitter":true},{"id":8,"name":"Musa","submission":"Hey, I\'m Musa, an artist from Bamako, Mali. 2023 has been a year of creative exploration and expression for me. Despite the world\'s challenges, art has been a source of solace and inspiration. I\'ve used my work to reflect on the social issues and cultural richness of Mali. Art has the power to unite people and provoke meaningful conversations. I\'m grateful for the opportunity to contribute to the cultural dialogue and showcase the beauty of our heritage through my art.","date":"2023-11-04","twitter":true},{"id":9,"name":"Amina","submission":"Hello, I\'m Amina, an aspiring scientist from Nairobi, Kenya. 2023 has been a year of discovery and curiosity. Despite the challenges in accessing research resources and labs, I\'ve pursued my passion for science with determination. I\'ve collaborated with mentors and fellow students, finding innovative ways to conduct experiments and research. The pursuit of knowledge knows no boundaries, and I\'m committed to contributing to scientific advancements that benefit our society and the world.","date":"2023-11-04","twitter":true},{"id":10,"name":"Jabari","submission":"Greetings, I\'m Jabari, a wildlife conservationist from Arusha, Tanzania. 2023 has been a year of conservation efforts and biodiversity preservation. Our natural habitats face threats from various factors, but dedicated conservation initiatives have made significant strides. We\'ve seen the return of endangered species and the rejuvenation of ecosystems. The collaboration between local communities, governments, and conservation organizations is crucial. Together, we are protecting our wildlife and ensuring a sustainable future for generations to come.","date":"2023-11-04","twitter":true},{"id":11,"name":"Aisha","submission":"I\'m Aisha, a 25-year-old software engineer from Lagos, Nigeria. My 2023 story has been a mix of ups and downs. On the one hand, I\'ve been fortunate enough to secure a job at a top tech company and start building my career. On the other hand, the economic situation in Nigeria has been challenging, and I\'ve had to deal with rising inflation and the high cost of living. Despite the challenges, I\'m optimistic about the future. I believe that Nigeria has a lot of potential, and I\'m excited to be a part of the generation that is working to build a better future for our country.","date":"2023-03-15","twitter":true},{"id":12,"name":"Kwame","submission":"Hello, I\'m Kwame from Accra, Ghana. This year has been a rollercoaster ride. I launched my own small business, and it started off well, but then we faced supply chain issues due to the global pandemic. It was tough, but my team and I persevered. We managed to adapt and find new suppliers. Now, we\'re back on track and growing stronger. It taught me the importance of resilience and adaptability.","date":"2023-05-10","twitter":true},{"id":13,"name":"Fatima","submission":"Greetings from Nairobi, Kenya! 2023 has been a transformative year for me. I completed my degree and landed my dream job in the field of environmental conservation. I\'ve had the opportunity to work on projects that are making a real impact on wildlife preservation. However, the political unrest in the region has been concerning. Despite the challenges, I remain hopeful that our collective efforts will lead to a more stable and sustainable future for Kenya.","date":"2023-06-20","twitter":false},{"id":14,"name":"Chijioke","submission":"I am Chijioke, a farmer from Enugu, Nigeria. This year, the weather patterns have been unpredictable, affecting our crop yields. It\'s been a tough time for farmers in our region. On a positive note, the community came together, sharing knowledge and resources to help each other cope. We learned new farming techniques and supported one another. It reminded me of the strength of our community bonds.","date":"2023-04-05","twitter":true},{"id":15,"name":"Lulama","submission":"Hello, I\'m Lulama from Cape Town, South Africa. 2023 has been a year of personal growth and self-discovery for me. I faced challenges at work and contemplated changing careers. After much reflection, I decided to pursue my passion for art. I enrolled in art school and started creating beautiful pieces that resonate with my soul. It\'s been a journey of finding my true calling and embracing my creativity.","date":"2023-07-12","twitter":false},{"id":16,"name":"Ngozi","submission":"I\'m Ngozi, a healthcare worker from Abuja, Nigeria. This year, the healthcare system has been under immense pressure due to the ongoing health crisis. We faced shortages of essential medical supplies and worked tirelessly to provide care to those in need. It was emotionally draining, but the resilience of my colleagues and the support from the community kept us going. I\'m proud of our collective strength and determination.","date":"2023-02-28","twitter":true},{"id":17,"name":"Omar","submission":"Greetings from Dar es Salaam, Tanzania! 2023 has been a year of community building for me. I started a local initiative to promote sustainable farming practices and environmental conservation. Together with fellow enthusiasts, we organized workshops and tree planting events. It\'s inspiring to see the community coming together to protect our environment and create a greener future for Tanzania.","date":"2023-09-08","twitter":false},{"id":18,"name":"Zara","submission":"Hello, I\'m Zara, a teacher from Dakar, Senegal. This year, I witnessed the resilience and determination of my students. Despite the challenges posed by the pandemic, they adapted to online learning and continued their education. It was a testament to their dedication and the support from their families. As an educator, it was heartening to see their unwavering commitment to learning.","date":"2023-11-02","twitter":true},{"id":19,"name":"Jabari","submission":"I am Jabari, an entrepreneur from Kigali, Rwanda. 2023 has been a year of innovation and collaboration. I co-founded a tech startup that focuses on renewable energy solutions. We partnered with local communities to install solar panels, providing clean and sustainable energy sources. It\'s been rewarding to witness the positive impact on people\'s lives and the environment.","date":"2023-08-17","twitter":true},{"id":20,"name":"Nia","submission":"Greetings, I\'m Nia from Addis Ababa, Ethiopia. This year, I faced personal challenges that tested my resilience. I lost my job due to economic uncertainties, and it was a difficult period of uncertainty. However, it gave me the opportunity to explore my passions and start my own online business. It\'s been a journey of self-discovery and entrepreneurship, and I\'m grateful for the lessons learned.","date":"2023-10-25","twitter":false}]');

